INSERT INTO `pacote` VALUES (1,'REVEILLON 2016','OBSERVAÇÕES GERAIS: Incluso:. Café da manhã: 07:00 ás 09:00 Almoço:. 12:00 ás 15:00 Jantar:. 19:00 ás 21:00, ceia e queima de fogos (dia 31/12) ;  01 criança até 05 anos acomodada com os pais é cortesia; CHECK-IN: 14:00 / CHECK-OUT: 12:00; salão de jogos, visitação ao refúgio dos animais,Exposição de animais (aos sábados domingos e feriados); Piscina do hotel exclusiva para os hóspedes; Reservas mediante solicitação e disponibilidade;  No hotel aceitamos todos os cartões de crédito, Com exceção( Banese, Hiper e ELO); Não aceitamos cheques; Não aceitamos animais domésticos de nenhum porte. A reserva só será confirmada mediante a quitação.',NULL,NULL,'2015-12-31','2016-01-04',0.00,0,0,11),(2,'NATAL 2015','OBSERVAÇÕES GERAIS: Incluso:. Café da manhã: 07:00 ás 09:00 Almoço:. 12:00 ás 15:00 Jantar:. 19:00 ás 21:00, ;  01 criança até 05 anos acomodada com os pais é cortesia; CHECK-IN: 14:00 / CHECK-OUT: 12:00; salão de jogos, visitação ao refúgio dos animais, ao Haras, , Exposição de animais (aos sábados domingos e feriados); Piscina do hotel exclusiva para os hóspedes; Reservas mediante solicitação e disponibilidade;  No hotel aceitamos todos os cartões de crédito, Com exceção( Banese, Hiper e ELO); Não aceitamos cheques; Não aceitamos animais domésticos de nenhum porte. A reserva só será confirmada mediante a quitação.',NULL,'','2015-12-23','2015-12-27',0.00,0,0,21),(3,'CARNAVAL','OBSERVAÇÕES GERAIS:\r\nIncluso:.\r\n \r\nCafé da manhã: 07:00 ás 09:00\r\nAlmoço:. 12:00 ás 15:00\r\nJantar:. 19:00 ás 21:00\r\n\r\n ; 01 criança até 05 anos acomodada com os pais é cortesia; CHECK-IN: 14:00 / CHECK-OUT: 12:00; salão de jogos, visitação ao refúgio dos animais, ao Haras, Exposição de animais (aos sábados domingos e feriados); Piscina do hotel exclusiva para os hóspedes; Reservas mediante solicitação e disponibilidade; No hotel aceitamos todos os cartões de crédito, com exceção(ELO, BANESE E HIPER; Não aceitamos cheques; Não aceitamos animais domésticos de nenhum porte. A reserva só será confirmada mediante a quitação.',NULL,NULL,'2016-02-05','2016-02-10',0.00,0,0,26),(4,'Semana Santa','Pacote de 4 dias  APT COM FAP E CHALE COM FAP com café da manhã, almoço e jantar!\r\n\r\nDia 24/03/2016\r\nApresentação da turma do Chaplin e o palhaço ligeirinho. \r\nDia 25/03/2016\r\nShow musical com Carlinhos Rasec na varando do hotel. \r\nDia 26/03/2016\r\nQueima do judas e fogueira , caça aos ovos com a turma do Chaplin e o palhaço ligeirinho ( brindes- serviços da fazenda e ovos n 06) + show musical com cantor preto .\r\nDia 27/03/2016\r\nEntrega de ovos de páscoa para as crianças no café da manha',NULL,NULL,'2016-03-24','2016-03-27',0.00,1,1,7);
